description:
Fathom: Blue Descent

English | CBR | 5 Issues

Genre: Action/Adventure, Fantasy, Science Fiction

Written by David Schwartz
Art by Scott Clark and Alex Sanchez

Collects FATHOM: Blue Descent #0-4.

Michael Turner's Fathom is explored to new depths in Fathom: Blue Descent! Aspen Matthews is the link between the world we know and the world below, but the secrets of her past have always remained shrouded in mystery-until now! Absaloma is Aspen's father and a member of the Blue, searching for answers to his own purpose within the ever-changing landscape under the surface. However, his self-exploration takes a back seat for a search far more important to his livelihood - the search for his captive wife -- and Aspen's mother -- Eilah! Kidnapped by the race known as The Black, Eilah's lurid nightmares of this mythical species came to horrifying life when their arrival indeed turned into a reality. Now, with a new focused determination and motivation, it is up to Abseloma and his trusted childhood friend Zo to rescue his wife!

